import React, { Component } from "react";

class Book extends Component {
  state = {
    title: "",
    type: "",
    k: "",
  };

  componentDidMount() {
    this.setState({
      title: this.props.title,
      type: this.props.type,
      k: this.props.key,
    });
  }

  render() {
    return (
      <div>
        <p>Title:{this.state.title}</p>
        <p>Type:{this.state.type}</p>
        <p>Key:{this.state.k}</p>
      </div>
    );
  }
}

export default Book;
